

# This is a SAS Component
package Nov_2016_AMR_Classifiers;
use strict;
use Data::Dumper;

our %AdaboostValues;

#Hash is returned in the form:

#Genus species -> classifier_name -> ANTIBIOTICS
#									-> ABBREVIATION (antibiotic abbrev if appropriate)
#								    -> ADABOOST	  -> Round of boosting -> Alpha Value
#								                                           -> Array of k-mers
#								    -> RESISTANT    -> String of resistant genome ids used to build the classifier
#                                   -> SUSCEPTIBLE  -> String of resistant genome ids used to build the classifier
#                                   -> AUC          -> Area under the ROC curve
#                                   -> F1           -> F1 Score
#                                   -> ACCURACY     -> Accuracy
#                                   -> COMMENTS     -> Some comments about the classifier
#                                   -> SOURCES      -> Major data sources
#									-> FUNCTION     -> Function string
								                         
sub Load_Adaboost
{
	my $alph = shift @_;
	my @alphas = split ("\n", $alph);
	my $count = 0;
	my %hash;
	foreach  (@alphas)
	{
		my @array = split /\t/;
		my $alph = shift @array;
		$hash{$count}{ALPHA} = $alph;
		$hash{$count}{KMERS} = \@array;
		$count ++;
	}
	return %hash;
}

